import styled from "styled-components";
import { Container } from "react-bootstrap";

export const Bigbox = styled(Container)`
  .container-fluid {
    padding-left: 30px;
    padding-right: 30px;
  }
  padding: 30px!important;
  border: 1px solid #c4c4c4;
`;
